import React from 'react';

interface Song {
    artist: string;
    songName: string;
    duration: number
}

const Menu: React.FC<Song> = () => {
    return(
        <div>
            <ul>
                <li>Katy Perry</li>
                <li></li>
                <li>Eminem</li>
            </ul>
        </div>
    )
}

export default Menu;
